import { Link } from "react-router-dom";
import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import Accordion from 'react-bootstrap/Accordion';

import ItemModal from '../ItemModal.js';

import item1 from '../../../images/products/supplements-natural-antioxidants/omega3.jpg';
import item2 from '../../../images/products/supplements-natural-antioxidants/spirulina-hawaiian.jpg';
import item3 from '../../../images/products/supplements-natural-antioxidants/time-c500-with-rose-hip.jpg';

function NaturalAntiOxidants () {

    const [show, setShow] = useState(false);
    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);


    const category = "Supplements / Natural anti-oxidants";
    const products = [
        {
            id:1, 
            name:"Omega-3", 
            image: item1
        },
        {
            id:2, 
            name:"Spirulina Hawaiian", 
            image: item2
        }, 
        {
            id:3, 
            name:"Time C-500 with Rose Hip", 
            image: item3
        }
    ];

    const productList = products.map((product) =>(

        <div className="col col-sm-4 itemCard" key={product.id}>
            <div className="itemImage">
                <Link href={() => false} onClick={handleShow}><img src={product.image} alt={product.name}/> </Link>
            </div>
            <div className="itemInfo">
                <Link href={() => false} onClick={handleShow}><p className="itemName">{product.name}</p> </Link>
                <p className="itemDesc">{category}</p>
            </div>
        </div>

    ));


    return (
        <>


            <div className="side-title">
                <h5>Natural anti-oxidants</h5>
                <hr></hr>
            </div>

            <div className="row itemContainer">
                {productList}
            </div>


            <div>
                {show ? (

                    <Modal onHide={handleClose} className="itemModal">

                    <Modal.Header closeButton>
                        <Modal.Title>natural anti-oxidants test</Modal.Title>
                    </Modal.Header>
        
                    <Modal.Body>
        
                        <div className="modalImage">
                            <img src={item1} alt=""/>
                        </div>
        
                        <div className="modalInfo">
                            <Accordion defaultActiveKey="0" flush>
                                <Accordion.Item eventKey="0">
                                    <Accordion.Header>About the product</Accordion.Header>
                                    <Accordion.Body>
                                        <p>Improves immunity. For maintenance of health, prevention of coughs and colds. A convenient time-release formulation ensures maximum absorption and constant high level of Vitamin C in the body.</p>
                                        <p>Pack size: 30 tablets</p>
                                        <p>Product of: Italy</p>
                                        <p>Only available in clinics and specialist centres</p>
                                    </Accordion.Body>
                                </Accordion.Item>
                                <Accordion.Item eventKey="1">
                                    <Accordion.Header>Product ingredients</Accordion.Header>
                                    <Accordion.Body>
                                    <p>Improves immunity. For maintenance of health, prevention of coughs and colds. A convenient time-release formulation ensures maximum absorption and constant high level of Vitamin C in the body.</p>
                                    </Accordion.Body>
                                </Accordion.Item>
                                <Accordion.Item eventKey="2">
                                    <Accordion.Header>Dosage instructions</Accordion.Header>
                                    <Accordion.Body>
                                    <p>Improves immunity. For maintenance of health, prevention of coughs and colds. A convenient time-release formulation ensures maximum absorption and constant high level of Vitamin C in the body.</p>
                                    </Accordion.Body>
                                </Accordion.Item>
                            </Accordion>
                        </div>
        
        
                    </Modal.Body>
        
                    <Modal.Footer>
                        <Button variant="primary" onClick={handleClose}>Close</Button>
                    </Modal.Footer>
        
                    </Modal>


                ) : (
                    "testingfdhfjkshfjds"
                )}
            </div>


        </>
    );
}

export default NaturalAntiOxidants;
